import React from "react";


const Footer = () => {
  return (
   <div>
       <div className="row">
         <div className="col-xs-12 col-sm-4 col-md-4">
         <img className='LogoHeader' src='../../MoniemHr/mn3m.git/assesst/Logo.png' />
         </div>
         <div className="col-xs-12 col-sm-4 col-md-4">
            <h3>Links</h3>
         </div>
         <div className="col-xs-12 col-sm-4 col-md-4">
          <h3>who are we</h3>
         </div>
       </div>
   </div>
  );
}

export default Footer;
